import logo from './logo.svg';
import './App.css';
import Home from './root-folder/pages/Home';
import { BrowserRouter, Route, Routes } from 'react-router-dom';
import TeamMembers from './root-folder/allcomponents/about/TeamMembers';

function App() {
  return (
    <>
        <Routes>
          <Route path="/TeamMembers" component={TeamMembers} />
        </Routes>
      <Home />
    </>
  );
}

export default App;
